import React from 'react';
import '../stylesheets/Articles.css';

function Articles() {
  return (
    <div className="articles">
      <div className="article">
        <h2 className="article-title">My First Article</h2>
        <p className="article-meta">March 21, 2023</p>
        <div className="article-content">
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed vitae diam quam. Integer non facilisis orci. Donec sit amet varius lorem. Sed ac libero felis. In hac habitasse platea dictumst. Suspendisse potenti. Duis eget quam at velit fringilla vulputate vitae vel dolor.</p>
          <p>Phasellus sollicitudin malesuada cursus. Proin ut sem nec mauris pellentesque tincidunt. Nulla id est urna. Suspendisse euismod porttitor nulla, at consequat mi ullamcorper in. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Donec eu imperdiet odio.</p>
        </div>
      </div>
    </div>
  );
}

export default Articles;
